    >
        <path
            d="M14 12a2 2 0 11-4 0 2 2 0 014 0zM14 4a2 2 0 11-4 0 2 2 0 014 0zM14 20a2 2 0 11-4 0 2 2 0 014 0z"
            fill="#FAFAFA"
